import React from 'react';
import {
    MDBCard,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBCardImage,
    MDBRipple
} from 'mdb-react-ui-kit';

export default function Card(props) {
    const days = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday"];

    return (
        <MDBCard>
            <MDBRipple className='bg-image hover-overlay'>
                <MDBCardImage src='https://mdbootstrap.com/img/new/standard/nature/111.webp' fluid alt='...' />

            </MDBRipple>
            <MDBCardBody>
                <MDBCardTitle>{props.coach.username.split("@")[0]}</MDBCardTitle>
                <MDBCardText>
                    <p>Swimming Style: {props.coach.swimmingStyle.map(style => { return style + " " })}</p>

                </MDBCardText>
            </MDBCardBody>
        </MDBCard>
    );
}
